    var timeActual = new Date();
    var acumularTime = timeActual - timeInicial; //console.log("La diferencia de fechas es :",acumularTime)

    var acumularTime2 = new Date();
    acumularTime2.setTime(acumularTime); //console.log("el acumularTime2es :",acumularTime2)

    var cc = Math.round(acumularTime2.getMilliseconds() / 10);
    var ss = acumularTime2.getSeconds();
    var mm = acumularTime2.getMinutes();

